[{"name": "mcp__togomcp__search_chembl_molecule", "input": {"query": "cetirizine", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX chembl: <http://rdf.ebi.ac.uk/terms/chembl#>
PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?atc_code ?atc_level
WHERE {
  ?molecule a chembl:SmallMolecule ;
            chembl:chemblId "CHEMBL1000" ;
            chembl:atcClassification ?atc .
  ?atc chembl:level ?atc_level ;
       chembl:code ?atc_code .
}
ORDER BY ?atc_level"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT ?atc ?level ?code
WHERE {
  ?mol cco:chemblId "CHEMBL1000" .
  ?mol cco:atcClassification ?atc .
  ?atc cco:level ?level .
  ?atc cco:code ?code .
}
ORDER BY ?level"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT ?atcCode
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?molecule a cco:SmallMolecule ;
            cco:chemblId "CHEMBL1000" ;
            cco:atcClassification ?atcCode .
}
"}}]

[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "BRCA1 human", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?chromosome ?location
WHERE {
  <http://purl.uniprot.org/uniprot/P38398> up:encodedBy ?gene .
  ?gene up:locatedOn ?chromosomeLocation .
  ?chromosomeLocation up:chromosome ?chromosome ;
                      up:band ?location .
}
LIMIT 10"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?chromosome ?band
WHERE {
  <http://purl.uniprot.org/uniprot/P38398> up:encodedBy ?gene .
  ?gene rdfs:seeAlso ?ensembl .
  OPTIONAL { ?ensembl up:locatedOn ?loc . 
             ?loc up:chromosome ?chromosome .
             OPTIONAL { ?loc up:band ?band }
  }
}
LIMIT 10"}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1 AND human[organism]", "max_results": 5}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["7157"]}}, {"name": "mcp__togomcp__ncbi_esearch", "input": {"database": "gene", "query": "BRCA1[Gene Name] AND Homo sapiens[Organism]", "max_results": 1}}, {"name": "mcp__togomcp__ncbi_esummary", "input": {"database": "gene", "ids": ["672"]}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chebi", "sparql_query": "
